            <tr>
                <td>{{ hygiene.id }}</td>
                <td>{{ hygiene.coucheUrine ? 'Yes' : 'No' }}</td>
                <td>{{ hygiene.coucheSelle ? 'Yes' : 'No' }}</td>
                <td>{{ hygiene.bain ? 'Yes' : 'No' }}</td>
